// import logo from './img/1.jpg';
import Navbar from './Halpper/navabar';
import './App.css';
import logo from './img/logo.jpg'
import Imgeshow from './Halpper/imgshow'
import ImgeShow from './Halpper/imgshow';
import imgdic from './Data/Imgedata'

function App() {

  const headdermaker=()=>{
    let data="Zeel Prajapati's Personal Web Site"
    let ans=document.querySelector(".logo-text");
    for(let i=0;i<data.length;i++){
      let new_span=document.createElement("span")
      new_span.id="ht"
      new_span.innerHTML=data[i]
      ans.appendChild(new_span)
    }

  }
  return (
    <>
    <header>
      <img className="logo" src={logo}></img>
      <span className="logo-text">
        {
          headdermaker()
        }
      </span>
    </header>
    <Navbar />
      <ImgeShow imgdic={imgdic}></ImgeShow>
      <ImgeShow imgdic={imgdic}></ImgeShow>

      <div name="intro">
        zeel
      </div>
    </>




  );
}

export default App;
